import React from 'react';
import '../../Styles/ShowPopupForm.css';


const ShowPopupForm = () => {
  return (
    <form className='popupform_container'>
      <div>
        <label htmlFor="TaskName"></label>
        <input type="text" name="TaskName" id="taskname_input" className='popup_input'/>
      </div>
      <div>
        <label htmlFor="TaskEndDate"></label>
        <input type="date" name="TaskEndDate" id="taskenddate_input" className='popup_input'/>
      </div>
      <div>
        <label htmlFor=""></label>
      </div>
      <input type="time" name="" id="taskendtime_input" className='popup_input'/>
      <input type="checkbox" name="" id="taskfavourite_input" className='popup_checkbox'/>
      <input type="checkbox" name="" id="taskcomplete_input" className='popup_checkbox'/>
      <button type="reset" id="popupform_rst_btn" className='popup_btn'>Clear</button>
      <button type="submit" id="popupform_submit_btn" className='popup_btn'>Submit</button>
    </form>
  )
};

export default ShowPopupForm;
